        //Auto focus username field if user come in from the landing page - with a vaid email
        function getUrlParameter(sParam) {
            var sPageURL = decodeURIComponent(window.location.search.substring(1)),
                sURLVariables = sPageURL.split('&'),
                sParameterName,
                i;

            for (i = 0; i < sURLVariables.length; i++) {
                sParameterName = sURLVariables[i].split('=');

                if (sParameterName[0] === sParam) {
                    return sParameterName[1] === undefined ? true : sParameterName[1];
                }
            }
        };
        $( document ).ready(function() {
            var redirect = getUrlParameter('redirect');
            var socialLogin = getUrlParameter('source_name');
            if (redirect || socialLogin) {
                var email = getUrlParameter('email');
                if (email) {
                    $('#signupform-emailaddress').removeAttr('autofocus');
                    setTimeout(function(){
                        $('#signupform-username').focus();
                    }, 10);
                } else if ($('#signupform-emailaddress').attr('disabled')) {
                    $('#signupform-emailaddress').removeAttr('autofocus');
                    setTimeout(function(){
                        $('#signupform-username').focus();
                    }, 10);
                }
            }
        });
